import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Login.css";

const SellerSignUpPage = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    fullName: "",
    orgName: "",
    businessNumber: "",
    businessEmail: "",
    password: "",
  });

  const [showPassword, setShowPassword] = useState(false);
  const togglePassword = () => setShowPassword(!showPassword);
  const [showConfirm, setShowConfirm] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // const handleSubmit = (e) => {
  //   e.preventDefault();
  //   console.log("Seller Sign Up Data:", formData);
  //   alert("Seller account created successfully!");
  // };

  const handleSubmit = (e) => {
  e.preventDefault();

  fetch("http://localhost:9000/seller/apply", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify(formData)
  })
    .then((res) => res.json())
    .then((data) => {
      // show confirmation modal instead of alert
      setShowConfirm(true);
    })
    .catch(() => alert("Error submitting application"));
};


  return (
    <div className="seller-signup-wrapper">
      <div className="seller-message-frame">
        <h1 className="seller-welcome-title">Welcome to LiftOff</h1>
        <p className="seller-message-text">
          Are you interested in becoming a seller with us? Please complete the signup process using the link below. Our team will review your submission and respond within 2‚Äì3 business days.
        </p>
      </div>


      <div className="login-container">
        <div className="login-card" style={{ paddingBottom: "40px" }}>
          {/* ======= HEADER ======= */}
          <div className="login-header">
            <h2 className="logo-text">LiftOff</h2>
          </div>

          {/* ======= FORM ======= */}
          {showConfirm ? (
            <div className="confirm-card inline-confirm">
              <h3>Application submitted</h3>
              <p>
                Your seller application has been submitted and is pending
                approval! Please give the system 1 business day to process your
                status. Click the Confirm button below to confirm that you have
                read this and be directed to the homepage.
              </p>

              <div className="confirm-actions">
                <button
                  className="neu-button signup-btn"
                  onClick={() => {
                    setShowConfirm(false);
                    navigate("/");
                  }}
                >
                  Confirm
                </button>
